import React from "react";
import TableMUI from "./components/TableMUI";
import Header from "./components/Header";

// In order to use the React Router DOM we wrap the whole thing inside the BrowserRouter component, which we get from "react-router-dom" module. 

function App() {
  return (
    <div className="App">

    <Header />

    <TableMUI />

    </div>
  );
}

export default App;
